    CalendarWeekViewComponent,
    CalendarMonthViewComponent,
    CalendarDatePipe
  ],
  entryComponents: [CalendarTooltipWindowComponent]
})
export class CalendarModule {

  static forRoot(): ModuleWithProviders {

    return {
      ngModule: CalendarModule,
